# Question 1 (20 marks)

In this question:

- Recall that $R^T$ denotes the **transpose** of a matrix $R$
- Recall that $R \in \mathbb{R}^{m \times n}$ means that $R$ is a matrix with $m$ rows and $n$ columns, with real-valued entries.


- For a matrix $R$, we will denote the $i^{th}$ eigenvalue of $R$ as $\lambda_i(R)$, and the $i^{th}$ eigenvector as $v_i(R)$


---
a. You're free to use any numpy / linear algebra functions you like in this question.

- Make a function `my_transf(A)` that returns the sum of a matrix `A` and its' transpose `A·µÄ`. 

- Make a function `eigprod(A::Matrix,i::Number,j::Number)` that takes in a square matrix `A` and returns the dot product of the $i^{th}$ and $j^{th}$ eigenvectors of `A`. 

- Construct `A` as a $4 \times 4$ matrix of random numbers (drawn from any probability distribution). Explore the value of `eigprod(my_transf(A),i,j)` for different values of $i$ and $j$, and different random matrices $A$. You only need to show one matrix and value of $(i,j)$ in your answer. What do you notice? 

(5 marks)

---
d. Explain the reason for what you noticed. Manipulating the following  equation: 

$$v_2(R)^T \times (R^T - R) \times v_3(R)$$

(where $\times$ denotes matrix multiplication) might help 

(4 marks)

---
e. 

- Let $v_i$ be the $i^{th}$ eigenvector of `my_transf(A)`, where $A$ is an arbitrary matrix.

- Suppose what you noticed in part c. was true. Are any of the eigenvectors linearly dependent on each other? 

*Taking the dot product of $v_1$ (or $v_i$) with a weighted sum of the other eigenvectors and seeing what happens might help you here!*


(5 marks)

---

f. What does your answer to e. (whatever it was) say about the dimension of the vector space spanned by these eigenvectors? 

(2 marks)

---


g. For which values of $\theta$ do the following three vectors form a basis of $\mathbb{R}^3$?:

$$\{[\cos^2(\theta), 2, -1], \quad [\sin^2(\theta), -2, 1], \quad [1,6,-3] \}$$

*Hint: can we (/not) make **any vector** out of a weighted sum of these three?*

(4 marks)

---

