# Question 2 (15 marks)

The variable `electricity_prices` contains two months of data on hourly electricity prices (pence per Kilowatt-hour). The 24 columns represent the 24 hours of the day, starting from midnight.

*The functions you write in parts a, b, and c will ideally be 1/2 lines of code at most. Ideally avoid unnecessary array allocations. You can use `np.mean` or equivalent, but avoid other prebuilt statistical functions.*

a) Build a function `mu(i)`, which returns the mean electricity price over the period for the ith hour of the day. So `mu(8)` returns the average 8am-9am price.

(2)

---
b) Build a function `mycov(i)` that returns the covariance between the electricity prices at hours `i` and `j`. You can/should use the function from part a). We define the covariance between two random variables $X_i$ and $X_j$ as 

$\mathbb{E}[(X_i - \mu_i)(X_j - \mu_j)]$,
where $\mu_i = \mathbb{E}[X_i]$ and $\mu_j = \mathbb{E}[X_j]$.


(3)

---
c) Use your `mycov` function to build a matrix $\Sigma$, where 

$\Sigma_{ij} = \mathbb{E}[(X_i - \mu_i)(X_j - \mu_j)]$

(2)

---

d) Plot a heatmap of $\Sigma$, using a `heatmap` function from your chosen plotting library. Name and explain at least three interesting geometrical features of your heatmap. Include in your discussion which of these features tell you something interesting about your data, which would be true of _any_ dataset, and which are hard to label as dataset-dependent vs dataset-independent.

(5)

---

e) Make a similar heatmap of a different matrix $\Sigma$ where $\Sigma_{ij}$ compares the covariance of the electricity price on hour `i` with that of hour `j` _on the previous day_. Does this tell you anything interesting?

*`np.roll` (python) or `circshift` (julia) may be helpful functions to look up*

(3)

