	- In the lectures, we used $\mathbb{I}_n$ as the $n \times n$ identity matrix 
	- In the next question additional notation $\mathbf{1}_n$ will be useful. It denotes an $n-$vector of ones. 
	- An $m \times n$ matrix of zeros can be denoted $\mathbf{0}_{m,n}$
	- An $n$-vector of zeros can be denoted $\mathbf{0}_n$
	So e.g.

	$\mathbf{1}_3 = \begin{bmatrix} 1 \\ 1 \\ 1 \end{bmatrix} \quad \quad \mathbf{0}_3 = \begin{bmatrix} 0 \\ 0 \\ 0 \end{bmatrix} \quad
	\mathbf{0}_{2,3} = \begin{bmatrix} 0 & 0 & 0 \\ 0 & 0 & 0 \end{bmatrix}$.

	You can write these in $\LaTeX$ using the commands `\mathbf{1}_3` and `\mathbf{0}_3`

	---
	#### Block matrix notation

	Consider four matrices: $A,B,C,D$. As long as the shapes align appropriately, you can concatenate them in a **block matrix**:
	$\begin{bmatrix} 
	A & B \\ C & D.
	\end{bmatrix}$
	This concatenates them all into one big matrix. EG 

	$\begin{bmatrix} \mathbb{I}_2 & \mathbf{0}_2 \\ \mathbf{1}_2^T & 3 \end{bmatrix} = \begin{bmatrix} 1 & 0 & 0 \\ 0 & 1 & 0 \\ 1 & 1 &3 \end{bmatrix}$
