# Question 3 (20  marks)

Each day we want to buy 100KwH from the grid for domestic use. We want to buy at cheap times. We have a battery, so are also happy to discharge (sell) at expensive times if it lowers the overall price.

- Let $\underline{x} \in \mathbb{R}^{24}$ be the vector of how much electricity we buy. So $x_i$ is the electricity bought at hour $i$. If $x_i < 0$, we sell electricity. This is our optimisation variable.

- Let $\underline{p} \in \mathbb{R}^{24}$ be the vector of expected hourly prices you calculated previously

We assume that $\underline{p}$ is the expected hourly cost on future days as well. A more sophisticated modeller might predict future cost with a more complex predictive model.


Batteries degrade faster if they are charged/discharged fast. As such, we decide that our objective on each day is to buy electricity so as to minimise:

$f(\underline{x}) = \text{monetary cost}(\underline{x}) + Œ≥ \sum_{i=1}^{24} x_i^2$
$\text{subject to } \sum_{i=1}^{24} x_i = 100$ 

This cost function discourages buying/selling large amounts of electricity in a given hour, which wears out the battery. $\gamma \in \mathbb{R}^+$ is a parameter signalling how much we penalise fast dis/charging.

---

a) Express the optimisation problem as a quadratic program:

$f(\underline{x}) = \min_\underline{x} \underline{x}^TQ\underline{x} + \underline{c}^T \underline{x}$
$\text{ subject to } h(\underline{x})= 0$

So essentially, you have to find the matrix $Q$ and the vector $\underline{x}$, and the function $h(\underline{x})$. Express $h$ as a dot product of two variables.

(3)



---

b) Write a matrix expression for the gradients of $f$ and $h$ with respect to $\underline{x}$: $\nabla f$ and $\nabla h$. Verify that these pen-and-paper gradients are correct by comparing them to gradients built using an autodiff package (e.g. ForwardDiff for Julia and Autograd/Jax for Python)

(5)

*Hints: find the partial derivatives with respect to $x_1$ and $x_2$ first. Then follow the pattern. It might(?) be easier to differentiate the original expression and then re-express it as a matrix, instead of differentiating directly the matrix expression you got in part a)*.

--- 

c) Use part b to express the Lagrange necessary conditions on optimality as matrix equations. Combine these matrix equations into a single matrix equation. Expressing this mathematically as a block matrix might help with clarity (see hint at top of question). The final equation should look something like: 

$A \begin{bmatrix} \underline{x} \\ \lambda \end{bmatrix} = \underline{b},$

where you find $A$ and $\underline{b}$, and $\lambda$ is the Lagrange multiplier.
(5)

----


d) 

If you managed to do part c), your matrix equation depends on $\gamma$. Make an interactive slider element for $\gamma$. Then solve the matrix equation in Python/Julia. The solution should change as you move $\gamma$. I suggest sliding $\gamma$ between 0.01 and 1.

**If you didn't** manage to do part c), use a quadratic programming package to solve the optimisation problem instead, still using a slider for $\gamma$.

(4)

e) Draw a scatter plot of how much electricity you should buy at each hour of day, which changes as you move $\gamma$. Interpret the solution, referring to mean electricity prices. Under what conditions (roughly) do you end up selling electricity, and when?

(3)

**Bonus question**
Now 'solve' the problem by doing gradient descent on the Lagrangian of the problem. Mathematically, it should work. Computationally, it won't work (at least not for me!). Write a few sentences on why it doesn't work. Unless you get it to work, in which case extra bonus points!

More generally, gradient descent is often ill-conditioned and doesn't work nicely in practice on constrained problems. We found a nice way of solving the optimisation problem in this question without it. Convex/quadratic programming packages use fancier techniques in the same spirit.
