# Question 4 (25 marks)

- In this question, $t$ denotes time. 
- Recall that $\dot{x}(t)$ denotes the time derivative of a time-varying quantity $x(t)$. In other words, $\dot{x}(t)$ is shorthand for $\frac{\d x}{\d t}(t)$.

---


We're going to build a model of interacting predator and prey populations. We model births and deaths of predators and prey. We will refer to this as the *basic model*.

$$\begin{align}
\dot{N}(t) &= a N(t) - b N(t) P(t) \\
\dot{P}(t) &= c N(t) P(t) - d P(t)
\end{align}$$

-  $N(t)$ is proportional to the number of prey  
-  $P(t)$ is proportional to the number of predators
- Note that $N(t)$ and $P(t)$ can be fractional in this model.
-  $a$ and $b$ are parameters that set the birth and death rates of prey.
-  $c$ and $d$ are parameters that set the birth and death rates of predators.


**a) What's the maximum predator population for which prey births still outstrip deaths?**

(2)

**b) Under what conditions is the predator population shrinking?**

(1)

**c) In this model, what do the dynamics of the prey population over time look like in the absence of predators ($P(0) = 0$)? Do you think this is reasonable? (*A verbal description without maths is sufficient, although you are welcome to use equations if you like*)** (2)

Let's now modify the predator-free (i.e. $P(0)=0$) prey dyamicsc to be: 

$$\begin{align}
\dot{N}(t) = a N(t) \left(1 - \frac{N(t)}{K} \right)
\end{align}$$

where $K > 1$ is a parameter we will ask you to describe. 

**d) What are the fixed points of the prey dynamics? How would you interpret the parameter $K$?** (2)

---

We now provide you with code for simulating the model above (see below). This consists of two functions, which you can inspect below. All can be seen in the live docs. Read them to help answer the remainder of question 5, which is situated below the code.

- `parameterise_basic_model`
- `solve`


We also provide a variable `data`, that provides noisy data on the predator and prey populations taken by a biologist...

- `data[:,1]` contains the timepoints (measured in years) over which the data was taken
- `data[:,2]` represents the estimated prey population (measured in hundreds, i.e. `data[2,2] = 3` means 300 estimated animals at timepoint 2) over these timepoints
- `data[:,3]` represents the predator population over these timepoints, measured in tens.

"""

# ‚ïî‚ïê‚ï° ccde450e-afaa-49a4-a197-89a754d29a23
function parameterise_basic_model(p)
	a,b,c,d = p
	function model(x,t)
		N, P = x
		return[ a*x[1] - b*prod(x);
			c*prod(x) - d*x[2]
		]
	end
	return model
end

# ‚ïî‚ïê‚ï° 6236f9a6-3a03-47e0-a57c-75a8a7836891
basic_model = parameterise_basic_model([1,4,1,4])

# ‚ïî‚ïê‚ï° 8038991d-0b49-46b4-8ee4-743498fafb87
"""
	solve(f::Function, tspan, x0::Vector)

Numerically solves the ODE 
xÃá(t) = f(x(t), t)

on the timespan whose start/end points are enclosed in tspan. Recall that xÃá denotes the time derivative of x(t), i.e. dx/dt.

> Example 
```julia
solve(f, (0,10), [1,0])
```
solves between `t=0` and `t=10`, using initial conditions `x0 =[1,0]`
"""
function solve(f::Function, tspan, x0::Vector)
	Œ¥t = 0.01
	ts = range(tspan[1], tspan[2], step=Œ¥t)
	xs = zeros(length(x0), length(ts))
	xs[:,1] = x0
	for i = 2:length(ts)
		xs[:,i] = xs[:,i-1] + Œ¥t*f(xs[:,i-1],ts[i])
	end
	return ts, xs' # recall that ' takes the transpose
end

# ‚ïî‚ïê‚ï° 80de72fd-5953-4604-b33a-76010a3df3f5
plot(solve(basic_model, (0,10), [1,1])..., labels = ["prey" "predators"], linewidth=4, legendfontsize=16, xlabel="time", ylabel="population")

