$$a_{12} = 0.9 \quad a_{21} = 1.1 \quad \rho = 1.6$$
$$a_{12} = 1.1 \quad a_{21} = 0.9 \quad \rho = 1.6$$

**What are the requirements on the values of $a_{12}$ and $a_{21}$ for these fixed points to be stable?** (4)


